import React from 'react';
import Layout from '../../components/Layout';
import "./homeModule.css"

const Home = () => {

    return ( 
        <Layout title="Boutique" description="Trouvez votre bonheur" >
            <div className="mt-4 pt-4">
                <div id="main" class="row w-75 mx auto">
                     <div class="jumbotron-fluid m-main">
                    <h1 class="display-3">Jumbo heading</h1>
                    <p class="lead">Jumbo helper text</p>
                    <hr class="my-2"/>
                    <p>More info</p>
                    <p class="lead">
                        <a class="btn btn-primary" href="Jumbo action link" role="button">Jumbo action name</a>
                    </p>
                </div>
                    <div className="col-sm">
                    <img alt="..." className="w-100" src="https://images.unsplash.com/photo-1491553895911-0055eca6402d?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1400&q=80"/>
                    </div>
                </div>
            </div>
        </Layout>
     );
}

export default Home;
